
# TODO: part 2

path_str = """





""".strip()

path = path_str.split("\n")

keypad = [[1, 2, 3], [4, 5, 6], [7, 8, 9]]

cur_pos = [1, 1]


def update_pos(char):

	def clamp(value, min, max):
		
		if min < value < max:
			return value
		elif value <= min:
			return min
		return max
	# update_pos():
	if char == "R":
		cur_pos[1] += 1
	elif char == "L":
		cur_pos[1] -= 1
	elif char == "D":
		cur_pos[0] += 1
	elif char == "U":
		cur_pos[0] -= 1
	else:
		print("Invalid char " + char)

	cur_pos[0] = clamp(cur_pos[0], 0, 2)
	cur_pos[1] = clamp(cur_pos[1], 0, 2)



for route in path:
	for char in route:
		update_pos(char)

	print(keypad[cur_pos[0]][cur_pos[1]], end="")

print()

